import React, { useState } from "react";

import classes from "./Notes.module.css";

const Notes = (props) => {
  return (
    <div className={classes.Notes}>
      {props.children.map((item) => {
        return (
          <div key={item._id} className={classes.Card}>
            {item.title}
          </div>
        );
      })}
    </div>
  );
};

export default Notes;
